export default function Form({ handleText, text }) {
  return (
    <form>
      <label htmlFor="">Lag en ny oppgave</label>
      <input
        onChange={handleText}
        type="text"
        value={text}
        placeholder="Hva vil du utsette?"
      />
      <button type="button">Add Todo</button>
    </form>
  )
}
